import React from 'react'
import img1 from '../../../public/'
function Navbar() {
    return (
        <>
            <header className="d-flex d-none d-lg-block">
                <img src='/public/images/baner.png' className='img-fluid'></img>
            </header>
        </>
    )
}

export default Navbar
